    const [articleList, setArticleList] = useState([]);

    useEffect(() => {
        async function fetchData() {
          const response = await axios.get("http://localhost:4000/articles.json", { headers: { Accept: "application/json" } });
          setArticleList(response.data);
        }
        fetchData();
      }, []);

